import React, { Component } from "react";
import { Route, NavLink, HashRouter } from "react-router-dom";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";

//Pages
import HomePage from "./views/Home/Home.jsx";
import ContactPage from "./views/Contact/Contact.jsx";
import AboutPage from "./views/About/About.jsx";
import VideoPage from "./views/Videos/Videos";
import ShopPage from "./views/Shop/Shop";
 
class Main extends Component {
  render() {
    return (
        <HashRouter>
        <div>
          <Navbar bg="primary" expand="lg" variant="dark">
            <Navbar.Brand href="/">Music Adventure Box</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ml-auto" activeKey={this.props.activeKey}>
              <Nav.Item>
                <Nav.Link href="/">Home</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link href="/contact">Contact</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link href="/about">About</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link href="/shop">Shop</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link href="/videos">Videos</Nav.Link>
              </Nav.Item>
            </Nav>
            </Navbar.Collapse>
          </Navbar>
          <div className="content">
            <Route path="/contact" component={ContactPage} />
            <Route path="/videos" component={VideoPage} />
            <Route path="/shop" component={ShopPage} />
            <Route path="/about" component={AboutPage} />
            <Route exact="/" component={HomePage} />
          </div>
        </div>
        </HashRouter>
    );
  }
}
 
export default Main;
